const useFetch = () => {
  const webshopItems = fetch("http://localhost:1337/products", {
    method: "GET",
    headers: {
      "Content-Type": "application/json",
    },
  })
    .then((response) => response.json())
    .then((data) => console.log(data));

  return { webshopItems };
};

export default useFetch;
